The Swinger 6 (Split Scenes)
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Chris is working late trying to make partner at a law firm and his wife is pissed because it's cutting into their swinging lifestyle. She's got an idea that maybe their swinging can actually help him get ahead! Starring fabulous Adriana Chechik as the wife, sophisticated AJ Applegate as the law partner's wife, sensuous Scarlet Red as a swinger, and James Deen as Chris. With Marcus London as the partner. Tyler Nixon as a swinger and introducing Taylor Reed and Brett Ravage as oral enthusiasts.

Cast: Adriana Chechik, A.J. Applegate, Scarlet Red, - (bio), Taylor Reed, James Deen, - (bio), Tyler Nixon, Marcus London, James Avalon,Director

